package mid_project;

public class Karyawan {
	
	String kode;
	String nama;
	String jenisKelamin;
	String jabatan;
	Double gaji;
	
	public Karyawan(String kode, String nama, String jenisKelamin, String jabatan, Double gaji) {
		// TODO Auto-generated constructor stub
		this.kode = kode;
		this.nama = nama;
		this.jenisKelamin = jenisKelamin;
		this.jabatan = jabatan;
		this.gaji = gaji;
	}
}
